nimport { CellArray, CellInfo } from '@src/types';\nimport { bool, num, size } from '@src/testFramework/lib/reducer';\n\ndescribe('createData', () => {\n    it('It creates array of size=25 from 5x5', () => {\n        expect(createData(5, 5).length).toBe(25);\n    });\n});\n\ndescribe('recreateData', () => {\n    it('It creates array of size=25 from source=3x3 and size=5x5', () => {\n        const srcW = 3;\n        const srcH = 3;\n        const srcAr = createData(srcW, srcH);\n        expect(recreateData(srcAr, srcW, srcH, 5, 5).length).toBe(25);\n    });\n\n    it('It uses data of source array 3x3 when constructs 5x5', () => {\n        const srcW = 3;\n        const srcH = 3;\n        const newW = 5;\n        const newH = 5;\n        const srcAr = createData(srcW, srcH);\n        const rndCell = (): CellInfo => (bool() ? CellInfo.alive : CellInfo.dead);\n        const clickedAr = srcAr.map((cell: CellInfo) => rndCell());\n        const recreatedAr = recreateData(clickedAr, srcW, srcH, newW, newH);\n\n        for (let y = 0; y <" + " srcH; y++) {\n            for (let x = 0; x <" + " srcW; x++) {\n                const newVisibleVal = recreatedAr[yx(y, x, newW)];\n                const oldVisibleVal = clickedAr[yx(y, x, srcW)];\n                expect(`(${y},${x}) ${newVisibleVal}`).toBe(`(${y},${x}) ${oldVisibleVal}`);\n            }\n        }\n    });\n\n    it('It uses data of source array 5x5 when constructs 3x3', () => {\n        const srcW = 5;\n        const srcH = 5;\n        const newW = 3;\n        const newH = 3;\n        const srcAr = createData(srcW, srcH);\n        const rndCell = (): CellInfo => (bool() ? CellInfo.alive : CellInfo.dead);\n        const clickedAr = srcAr.map((cell: CellInfo) => rndCell());\n        const recreatedAr = recreateData(clickedAr, srcW, srcH, newW, newH);\n\n        for (let y = 0; y <" + " newH; y++) {\n            for (let x = 0; x <" + " newW; x++) {\n                const newVisibleVal = recreatedAr[yx(y, x, newW)];\n                const oldVisibleVal = clickedAr[yx(y, x, srcW)];\n                expect(`(${y},${x}) ${newVisibleVal}`).toBe(`(${y},${x}) ${oldVisibleVal}`);\n            }\n        }\n    });\n});\n\ndescribe('randomFill', () => {\n    it('insert alive cells into array from probability 25%', () => {\n        const srcW = size(5) + 1;\n        const srcH = size(5) + 1;\n        const expectedAliveNumber = Math.floor(srcW * srcH * 0.25);\n        const ar: CellArray = {\n            width: srcW,\n            height: srcH,\n            data: createData(srcW, srcH),\n        };\n        const randomAr = randomFill(ar, 0.25);\n        const aliveNumber = randomAr.data.filter(\n            (cell: CellInfo) => cell === CellInfo.alive\n        ).length;\n        expect(aliveNumber).toBe(expectedAliveNumber);\n    });\n\n    it('insert alive cells into array from probability 50%', () => {\n        const srcW = size(5) + 1;\n        const srcH = size(5) + 1;\n        const expectedAliveNumber = Math.floor(srcW * srcH * 0.5);\n        const ar: CellArray = {\n            width: srcW,\n            height: srcH,\n            data: createData(srcW, srcH),\n        };\n        const randomAr = randomFill(ar, 0.5);\n        const aliveNumber = randomAr.data.filter(\n            (cell: CellInfo) => cell === CellInfo.alive\n        ).length;\n        expect(aliveNumber).toBe(expectedAliveNumber);\n    });\n\n    it('insert alive cells into array from probability 75%', () => {\n        const srcW = size(5) + 1;\n        const srcH = size(5) + 1;\n        const expectedAliveNumber = Math.floor(srcW * srcH * 0.75);\n        const ar: CellArray = {\n            width: srcW,\n            height: srcH,\n            data: createData(srcW, srcH),\n        };\n        const randomAr = randomFill(ar, 0.75);\n        const aliveNumber = randomAr.data.filter(\n            (cell: CellInfo) => cell === CellInfo.alive\n        ).length;\n        expect(aliveNumber).toBe(expectedAliveNumber);\n    });\n\n    it('throws if probability <" + "0', () => {\n        const srcW = size(5);\n        const srcH = size(5);\n        const ar: CellArray = {\n            width: srcW,\n            height: srcH,\n            data: createData(srcW, srcH),\n        };\n        const rndProbability = -1 * Math.random() - 0.1;\n        expect(() => randomFill(ar, rndProbability)).toThrow();\n    });\n\n    it('throws if probability >1', () => {\n        const srcW = size(5);\n        const srcH = size(5);\n        const ar: CellArray = {\n            width: srcW,\n            height: srcH,\n            data: createData(srcW, srcH),\n        };\n        const rndProbability = 1 + Math.random();\n        expect(() => randomFill(ar, rndProbability)).toThrow();\n    });\n});\n\ndescribe('getInverted', () => {\n    test('returns CellInfo.dead from CellInfo.alive', () => {\n        expect(getInverted(CellInfo.alive)).toBe(CellInfo.dead);\n    });\n\n    test('returns CellInfo.alive from CellInfo.dead', () => {\n        expect(getInverted(CellInfo.dead)).toBe(CellInfo.alive);\n    });\n});\n\ndescribe('getCicledX', () => {\n    const rndWidth = num();\n    const rndBaseX = size(rndWidth);\n\n    test.each`\n        x                      | width       | testName                                          | expected\n        ${rndBaseX}            | ${rndWidth} | ${'returns x if (0 <" + "= x <" + "= width-1)'}             | ${rndBaseX}\n        ${rndBaseX + rndWidth} | ${rndWidth} | ${'returns x-width if (width <" + "= x <" + "= 2*width-1)'} | ${rndBaseX}\n        ${rndBaseX - rndWidth} | ${rndWidth} | ${'returns x+width if (-width <" + "= x <" + " 0)'}         | ${rndBaseX}\n        ${0}                   | ${rndWidth} | ${'returns 0 from 0'}                             | ${0}\n        ${1}                   | ${rndWidth} | ${'returns 1 from 1'}                             | ${1}\n        ${-1}                  | ${rndWidth} | ${'returns width-1 from -1'}                      | ${rndWidth - 1}\n        ${rndWidth - 1}        | ${rndWidth} | ${'returns width-1 from width-1'}                 | ${rndWidth - 1}\n        ${rndWidth}            | ${rndWidth} | ${'returns 0 from width'}                         | ${0}\n        ${rndWidth + 1}        | ${rndWidth} | ${'returns 1 from width + 1'}                     | ${1}\n        ${-rndWidth - 1}       | ${rndWidth} | ${'returns width - 1 from (-width - 1)'}          | ${rndWidth - 1}\n    `('$testName', ({ x, width, expected }) => {\n        const ar: CellArray = { data: [], width: width, height: num() };\n\n        expect(getCicledX(ar, x)).toBe(expected);\n    });\n});\n\ndescribe('getCicledY', () => {\n    const rndHeight = num();\n    const rndBaseY = size(rndHeight);\n\n    test.each`\n        y                       | height       | testName                                             | expected\n        ${rndBaseY}             | ${rndHeight} | ${'returns y if (0 <" + "= y <" + "= height-1)'}               | ${rndBaseY}\n        ${rndBaseY + rndHeight} | ${rndHeight} | ${'returns y-height if (height <" + "= y <" + "= 2*height-1)'} | ${rndBaseY}\n        ${rndBaseY - rndHeight} | ${rndHeight} | ${'returns y+height if (-height <" + "= y <" + " 0)'}          | ${rndBaseY}\n        ${0}                    | ${rndHeight} | ${'returns 0 from 0'}                                | ${0}\n        ${1}                    | ${rndHeight} | ${'returns 1 from 1'}                                | ${1}\n        ${-1}                   | ${rndHeight} | ${'returns height-1 from -1'}                        | ${rndHeight - 1}\n        ${rndHeight - 1}        | ${rndHeight} | ${'returns height-1 from height-1'}                  | ${rndHeight - 1}\n        ${rndHeight}            | ${rndHeight} | ${'returns 0 from height'}                           | ${0}\n        ${rndHeight + 1}        | ${rndHeight} | ${'returns 1 from height + 1'}                       | ${1}\n        ${-rndHeight - 1}       | ${rndHeight} | ${'returns height - 1 from (-height - 1)'}           | ${rndHeight - 1}\n    `('$testName', ({ y, height, expected }) => {\n        const ar: CellArray = { data: [], width: num(), height: height };\n\n        expect(getCicledY(ar, y)).toBe(expected);\n    });\n});\n\ndescribe('getInvertedCellState', () => {\n    const rndCellState = (): CellInfo => {\n        const b = bool();\n        return b ? CellInfo.alive : CellInfo.dead;\n    };\n    const r = rndCellState;\n    it('returns alive from dead', () => {\n        expect(getInvertedCellState(r(), r(), r(), r(), CellInfo.dead, r(), r(), r(), r())).toBe(\n            CellInfo.alive\n        );\n    });\n\n    it('returns dead from alive', () => {\n        expect(getInvertedCellState(r(), r(), r(), r(), CellInfo.alive, r(), r(), r(), r())).toBe(\n            CellInfo.dead\n        );\n    });\n});\n\nconst rndCellState = (): CellInfo => {\n    const b = bool();\n    return b ? CellInfo.alive : CellInfo.dead;\n};\n\ndescribe('getInvertedCellState', () => {\n    const r = rndCellState;\n    it('returns alive from dead', () => {\n        expect(getInvertedCellState(r(), r(), r(), r(), CellInfo.dead, r(), r(), r(), r())).toBe(\n            CellInfo.alive\n        );\n    });\n\n    it('returns dead from alive', () => {\n        expect(getInvertedCellState(r(), r(), r(), r(), CellInfo.alive, r(), r(), r(), r())).toBe(\n            CellInfo.dead\n        );\n    });\n});\n\ndescribe('getNewField', () => {\n    it('calls calculator', () => {\n        const calculator = jest.fn();\n        const srcAr: CellArray = {\n            width: 2,\n            height: 2,\n            data: [CellInfo.dead, CellInfo.dead, CellInfo.dead, CellInfo.dead],\n        };\n        getNewField(srcAr, calculator);\n        expect(calculator).toHaveBeenCalled();\n    });\n\n    it('converts all cells from alive into dead', () => {\n        const srcAr: CellArray = {\n            width: 2,\n            height: 2,\n            data: [CellInfo.dead, CellInfo.dead, CellInfo.dead, CellInfo.dead],\n        };\n        expect(getNewField(srcAr, getInvertedCellState)).toEqual({\n            width: 2,\n            height: 2,\n            data: [CellInfo.alive, CellInfo.alive, CellInfo.alive, CellInfo.alive],\n        });\n    });\n});\n\ndescribe('getGOLCellState', () => {\n    test.each`\n        abcdfghi       | expected          | about\n        ${'000000000'} | ${CellInfo.dead}  | ${'remains dead'}\n        ${'111101111'} | ${CellInfo.dead}  | ${'remains dead'}\n        ${'111111111'} | ${CellInfo.dead}  | ${'dies of overcrouding'}\n        ${'111000000'} | ${CellInfo.alive} | ${'births'}\n        ${'000101100'} | ${CellInfo.alive} | ${'births'}\n        ${'010110010'} | ${CellInfo.alive} | ${'remains alive'}\n        ${'010100010'} | ${CellInfo.alive} | ${'births'}\n        ${'010110010'} | ${CellInfo.alive} | ${'remains alive'}\n        ${'010010010'} | ${CellInfo.dead}  | ${'dies of loneliness'}\n        ${'010010000'} | ${CellInfo.dead}  | ${'dies of loneliness'}\n        ${'000010000'} | ${CellInfo.dead}  | ${'dies of loneliness'}\n    `('returns $expected ($about) from $abcdfghi', ({ abcdfghi, expected }) => {\n        const toCellInfo = (num: string) => (num === '1' ? CellInfo.alive : CellInfo.dead);\n        const a = toCellInfo(abcdfghi[0]);\n        const b = toCellInfo(abcdfghi[1]);\n        const c = toCellInfo(abcdfghi[2]);\n        const d = toCellInfo(abcdfghi[3]);\n        const e = toCellInfo(abcdfghi[4]);\n        const f = toCellInfo(abcdfghi[5]);\n        const g = toCellInfo(abcdfghi[6]);\n        const h = toCellInfo(abcdfghi[7]);\n        const i = toCellInfo(abcdfghi[8]);\n\n        expect(getGOLCellState(a, b, c, d, e, f, g, h, i)).toBe(expected);\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/modules/AppStateManager/AppStateManager.spec.tsx":{"tests":[{"id":"48","name":"AppStateManager renders \"Game of life proto\"","location":{"start":{"column":6,"line":69}}},{" umn":6,"line":276}}},{"id":"64","name":"AppStateManager calls setTimeout() after click at PLAY button","location":{"start":{"column":6,"line":289}}},{"id":"65","name":"AppStateManager dispatches loadState() after mount","location":{"start":{"column":6,"line":306}}}],"source":"import React from 'react';\nimport { AppStateManager } from './AppStateManager';\nimport { render, screen, cleanup } from '@testing-library/react';\nimport userEvent from '@testing-library/user-event';\nimport { str } from '@src/testFramework/lib/reducer';\nimport {\n    LARGE_SIZE_CAPTION,\n    MIDDLE_SIZE_CAPTION,\n    Mode,\n    Size,\n    sizeToWH,\n    SMALL_SIZE_CAPTION,\n    Speed,\n} from '@src/consts';\nimport { StorageService } from '@src/StorageService';\nimport { Store } from 'redux';\nimport { AppActions, AppState, defaultAppState, replaceState } from '@src/store/ducks/game';\nimport { createMockStore } from '@src/testFramework/lib/store';\n\ndescribe('AppStateManager', () => {\n    const clearBoth = 1;\n    let storage: StorageService;\n    let store: Store;\n\n    beforeEach(() => {\n        const storageMock = {\n            state: defaultAppState,\n\n            setState(state: AppState) {\n                this.state = state;\n            },\n\n            getState(): AppState {\n                if (this.state) {\n                    return this.state;\n                }\n                return defaultAppState;\n            },\n\n            loadState: (): Promise<" + "AppState> => {\n                return new Promise((resolve, reject) => resolve(defaultAppState));\n            },\n\n            saveState: (): Promise<" + "void> => Promise.resolve(),\n        };\n        storage = storageMock as StorageService;\n\n        store = createMockStore();\n\n        jest.useFakeTimers();\n    });\n\n    const getCellIsAlive = (cell: Element) => {\n        const classes = [...cell.children[0].classList];\n        const cellIsVisible = classes.filter((s) => s === 'show').length === 1;\n        return cellIsVisible;\n    };\n\n    const getIdsOfAliveCells = (): number[] => {\n        const grid = screen.getByRole('grid');\n        const cells = [...grid.children].filter((cell: Element) => cell.tagName === 'ARTICLE');\n        const cellsIds = cells.map((cell: Element, index: number) =>\n            getCellIsAlive(cell) ? index : -1\n        );\n        const aliveCellsIds = cellsIds.filter((id: number) => id >= 0);\n        return aliveCellsIds;\n    };\n\n    it('renders \"Game of life proto\"', () => {\n        const { container, unmount } = render(<" + "AppStateManager storage={storage} store={store} />);\n        const caption = screen.getByText('Game of life');\n        expect(caption).toBeInTheDocument();\n        unmount();\n        expect(container.innerHTML).toBe('');\n    });\n\n    describe('parameterized tests', () => {\n        test.each`\n            clickAt                | testName                                              | sizeId\n            ${SMALL_SIZE_CAPTION}  | ${'renders field of size 5x5 on click at \"small\"'}    | ${Size.SMALL}\n            ${MIDDLE_SIZE_CAPTION} | ${'renders field of size 10x10 on click at \"medium\"'} | ${Size.MIDDLE}\n            ${LARGE_SIZE_CAPTION}  | ${'renders field of size 20x15 on click at \"large\"'}  | ${Size.LARGE}\n        `('$testName', ({ clickAt, sizeId }) => {\n            render(<" + "AppStateManager storage={storage} store={store} />);\n\n            const input = screen.getByLabelText('Enter your name:');\n            userEvent.click(input);\n            userEvent.type(input, str());\n            userEvent.click(screen.getByText('Start'));\n\n            userEvent.click(screen.getByText(clickAt));\n            const grid = screen.getByRole('grid');\n            expect(grid.children.length).toBe(\n                sizeToWH[sizeId as Size].w * sizeToWH[sizeId as Size].h + clearBoth\n            );\n        });\n    });\n\n    it('inverts a cell after click', () => {\n        const getCellIsAlive = (cell: Element) => {\n            const classes = [...cell.children[0].classList];\n            const cellIsVisible = classes.filter((s) => s === 'show').length === 1;\n            return cellIsVisible;\n        };\n\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        const grid = screen.getByRole('grid');\n        const firstCell = grid.children[0];\n        const startCellIsAlive = getCellIsAlive(firstCell);\n        userEvent.click(firstCell);\n        const newCellIsAlive = getCellIsAlive(firstCell);\n\n        expect(newCellIsAlive).toBe(!startCellIsAlive);\n    });\n\n    it('allows to click submit-button at LoginForm', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const rndName = str();\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, rndName);\n        userEvent.click(screen.getByText('Start'));\n    });\n\n    it('allows to click gameSpeed-medium-button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        const bt = screen.getByText('medium');\n        userEvent.click(bt);\n\n        expect(store.getState().game.speed).toBe(Speed.MEDIUM);\n    });\n\n    it('clears all cells after click at clear-button', () => {\n        const getCellIsAlive = (cell: Element) => {\n            const classes = [...cell.children[0].classList];\n            const cellIsVisible = classes.filter((s) => s === 'show').length === 1;\n            return cellIsVisible;\n        };\n\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        userEvent.click(screen.getByText('clear'));\n        const grid = screen.getByRole('grid');\n        const cells = [...grid.children].filter((cell: Element) => cell.tagName === 'ARTICLE');\n        const aliveCells = cells.filter((cell: Element) => getCellIsAlive(cell));\n\n        expect(aliveCells.length).toBe(0);\n    });\n\n    it('updates grid after click at fill-25%-button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        const aliveIdsBefore = getIdsOfAliveCells();\n        userEvent.click(screen.getByText('25%'));\n        const aliveIdsAfter = getIdsOfAliveCells();\n\n        expect(aliveIdsBefore).not.toEqual(aliveIdsAfter);\n    });\n\n    it('updates grid after click at fill-50%-button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        const aliveIdsBefore = getIdsOfAliveCells();\n        userEvent.click(screen.getByText('50%'));\n        const aliveIdsAfter = getIdsOfAliveCells();\n\n        expect(aliveIdsBefore).not.toEqual(aliveIdsAfter);\n    });\n\n    it('updates grid after click at fill-75%-button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        const aliveIdsBefore = getIdsOfAliveCells();\n        userEvent.click(screen.getByText('75%'));\n        const aliveIdsAfter = getIdsOfAliveCells();\n\n        expect(aliveIdsBefore).not.toEqual(aliveIdsAfter);\n    });\n\n    it('updates grid after click at fill-100%-button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        const aliveIdsBefore = getIdsOfAliveCells();\n        userEvent.click(screen.getByText('100%'));\n        const aliveIdsAfter = getIdsOfAliveCells();\n\n        expect(aliveIdsBefore).not.toEqual(aliveIdsAfter);\n    });\n\n    it('hides the grid after click at \"logout\"', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n        userEvent.click(screen.getByText('Logout'));\n\n        expect(screen.queryByRole('grid')).not.toBeInTheDocument();\n    });\n\n    it('switches UI to \"login\" mode after .componentDidMount() if props.storage.getState() === null', () => {\n        const badState = null as unknown as AppState;\n        const storageMock = {\n            state: badState,\n            setState(state: AppState) {\n                this.state = state;\n            },\n            getState(): AppState {\n                if (this.state) {\n                    return this.state;\n                }\n                return defaultAppState;\n            },\n            loadState: (): Promise<" + "AppState> => {\n                return new Promise((resolve, reject) => resolve(defaultAppState));\n            },\n\n            saveState: (): Promise<" + "void> => Promise.resolve(),\n        };\n        render(<" + "AppStateManager storage={storageMock} store={store} />);\n\n        expect(screen.queryByRole('grid')).not.toBeInTheDocument();\n    });\n\n    it('sets game.state.mode=Mode.PLAY after click at PLAY button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        userEvent.click(screen.getByText('play'));\n        expect(store.getState().game.mode).toBe(Mode.PLAY);\n    });\n\n    it('sets game.state.mode=Mode.PAUSE after click at PAUSE button', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        userEvent.click(screen.getByText('play'));\n        userEvent.click(screen.getByText('pause'));\n        expect(store.getState().game.mode).toBe(Mode.PAUSE);\n    });\n\n    it('calls setTimeout() after click at PLAY button', () => {\n        jest.spyOn(global, 'setTimeout');\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        store.dispatch(replaceState(store.getState().game));\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, str());\n        userEvent.click(screen.getByText('Start'));\n\n        userEvent.click(screen.getByText('play'));\n\n        store.dispatch(replaceState(store.getState().game));\n        jest.runOnlyPendingTimers();\n        expect(setTimeout).toHaveBeenCalled();\n    });\n\n    it('dispatches loadState() after mount', () => {\n        render(<" + "AppStateManager storage={storage} store={store} />);\n\n        expect(store.getState().game.event).toBe(AppActions.LOAD_STATE);\n    });\n\n    afterEach(() => {\n        jest.useRealTimers();\n        jest.restoreAllMocks();\n        cleanup();\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/store/ducks/game/game.spec.ts":{"tests":[{"id":"66","name":"gameReducer gameReducer-parameterized sets .fieldWidth from FIELD_SIZE action","location":{"start":{"column":10,"line":68}}},{"id":"67","name":"gameReducer gameReducer-parameterized sets .fieldHeight from FIELD_SIZE action","location":{"start":{"column":10,"line":68}}},{"id":"68","name":"gameReducer gameReducer-parameterized sets .data from FIELD_SIZE action","location":{"start":{"column":10,"line":68}}},{"id":"69","name":"gameReducer gameReducer-parameterized sets .size from FIELD_SIZE action","location":{"start":{"column":10,"line":68}}},{"id":"70","name":"gameReducer gameReducer-parameterized sets .event from INVERT action","location":{"start":{"column":10,"line":68}}},{"id":"71","name":"gameReducer gameReducer-parameterized sets .size=SMALL from badFieldSize","location":{"start":{"column":10,"line":68}}},{"id":"72","name":"gameReducer gameReducer-parameterized sets .fillPercent from FILL_PERCENT action","location":{"start":{"column":10,"line":68}}},{"id":"73","name":"gameReducer gameReducer-parameterized sets .userName from USER action","location":{"start":{"column":10,"line":68}}},{"id":"74","name":"gameReducer gameReducer-parameterized sets .userName from LOAD_STATE action","location":{"start":{"column":10,"line":68}}},{"id":"75","name":"gameReducer gameReducer-parameterized sets .userName from SAVE_STATE action","location":{"start":{"column":10,"line":68}}},{"id":"76","name":"gameReducer gameReducer-parameterized sets .userName from IO_ERROR action","location":{"start":{"column":10,"line":68}}},{"id":"77","name":"gameReducer gameReducer-parameterized sets .data from GENERATION action","location":{"start":{"column":10,"line":68}}},{"id":"78","name":"gameReducer gameReducer-parameterized sets .mode from MODE action","location":{"start":{"column":10,"line":68}}},{"id":"79","name":"gameReducer gameReducer-parameterized sets .speed from SET_SPEED action","location":{"start":{"column":10,"line":68}}},{"id":"80","name":"gameReducer gameReducer-parameterized sets .counter from SET_COUNTER action","location":{"start":{"column":10,"line":68}}},{"id":"81","name":"gameReducer inverts .visible of item(num) from INVERT action","location":{"start":{"column":6,"line":97}}},{"id":"82","name":"gameReducer sets state from REPLACE_STATE action","location":{"start":{"column":6,"line":107}}},{"id":"83","name":"gameReducer returns original state from unknown action","location":{"start":{"column":6,"line":115}}},{"id":"84","name":"gameReducer randomizes .data from FILL_PERCENT-25% action","location":{"start":{"column":6,"line":120}}},{"id":"85","name":"gameReducer randomizes .data from FILL_PERCENT-50% action","location":{"start":{"column":6,"line":128}}},{"id":"86","name":"gameReducer randomizes .data from FILL_PERCENT-75% action","location":{"start":{"column":6,"line":138}}},{"id":"87","name":"gameReducer randomizes .data from FILL_PERCENT-100% action","location":{"start":{"column":6,"line":148}}}],"source":"import { FillPercent, Mode, Size, sizeToWH, Speed } from '@src/consts';\nimport { bool, getFromState, getVal, str } from '@src/testFramework/lib/reducer';\nimport { CellInfo } from '@src/types';\nimport {\n    AppAction,\n    AppActions,\n    AppState,\n    defaultAppState,\n    fieldSize,\n    fillPercent,\n    generation,\n    invert,\n    ioError,\n    loadState,\n    mode,\n    replaceState,\n    saveState,\n    setCounter,\n    setSpeed,\n    user,\n} from './game';\nimport gameReducer from './game';\nimport { getGOLCellState, getInverted, getNewField } from './playFieldUtils';\n\nconst num = (size: number) => Math.round(size * Math.random());\n\ndescribe('gameReducer', () => {\n    describe('gameReducer-parameterized', () => {\n        const w = sizeToWH[Size.MIDDLE].w;\n        const h = sizeToWH[Size.MIDDLE].h;\n        const len = w * h;\n        const id = num(len);\n        const rndSize = (): Size => {\n            const rndNum = num(2);\n            const sizes = Object.keys(Size);\n            const rndSize = sizes[rndNum];\n            return rndSize as Size;\n        };\n\n        const rndPercent = (): FillPercent => {\n            const keys = Object.keys(FillPercent);\n            const index = Math.floor((keys.length - 1) * Math.random());\n            const val = keys[index] as FillPercent;\n            return val;\n        };\n\n        const rndS = rndSize();\n        const badFieldSize = 'uuu' as unknown as Size;\n        const rndP = rndPercent();\n        const rndName = str();\n        const rndAppState = { ...defaultAppState, userName: str() };\n        const rndError = str();\n        const nextData = getNewField(\n            {\n                data: defaultAppState.data,\n                width: defaultAppState.fieldWidth,\n                height: defaultAppState.fieldWidth,\n            },\n            getGOLCellState\n        );\n        const rndMode = bool() ? Mode.PLAY : Mode.PAUSE;\n        const rndSpeed = ((): Speed => {\n            const speedIndex = num(2);\n            return speedIndex === 0 ? Speed.SLOW : speedIndex === 1 ? Speed.MEDIUM : Speed.FAST;\n        })();\n        const rndCounter = num(100);\n\n        test.each`\n            actions                                 | testName                                        | event                      | stateSelector    | value\n            ${[fieldSize(Size.MIDDLE)]}             | ${'sets .fieldWidth from FIELD_SIZE action'}    | ${AppActions.FIELD_SIZE}   | ${'fieldWidth'}  | ${sizeToWH[Size.MIDDLE].w}\n            ${[fieldSize(Size.LARGE)]}              | ${'sets .fieldHeight from FIELD_SIZE action'}   | ${AppActions.FIELD_SIZE}   | ${'fieldHeight'} | ${sizeToWH[Size.LARGE].h}\n            ${[fieldSize(Size.MIDDLE)]}             | ${'sets .data from FIELD_SIZE action'}          | ${AppActions.FIELD_SIZE}   | ${'data.length'} | ${len}\n            ${[fieldSize(rndS)]}                    | ${'sets .size from FIELD_SIZE action'}          | ${AppActions.FIELD_SIZE}   | ${'size'}        | ${rndS}\n            ${[fieldSize(Size.MIDDLE), invert(id)]} | ${'sets .event from INVERT action'}             | ${AppActions.INVERT}       | ${null}          | ${null}\n            ${[fieldSize(badFieldSize)]}            | ${'sets .size=SMALL from badFieldSize'}         | ${AppActions.FIELD_SIZE}   | ${'size'}        | ${Size.SMALL}\n            ${[fillPercent(rndP)]}                  | ${'sets .fillPercent from FILL_PERCENT action'} | ${AppActions.FILL_PERCENT} | ${'fillPercent'} | ${rndP}\n            ${[user(rndName)]}                      | ${'sets .userName from USER action'}            | ${AppActions.USER}         | ${'userName'}    | ${rndName}\n            ${[loadState()]}                        | ${'sets .userName from LOAD_STATE action'}      | ${AppActions.LOAD_STATE}   | ${null}          | ${null}\n            ${[saveState(rndAppState)]}             | ${'sets .userName from SAVE_STATE action'}      | ${AppActions.SAVE_STATE}   | ${null}          | ${null}\n            ${[ioError(rndError)]}                  | ${'sets .userName from IO_ERROR action'}        | ${AppActions.IO_ERROR}     | ${'errorInfo'}   | ${rndError}\n            ${[generation()]}                       | ${'sets .data from GENERATION action'}          | ${AppActions.GENERATION}   | ${'data'}        | ${nextData.data}\n            ${[mode(rndMode)]}                      | ${'sets .mode from MODE action'}                | ${AppActions.MODE}         | ${'mode'}        | ${rndMode}\n            ${[setSpeed(rndSpeed)]}                 | ${'sets .speed from SET_SPEED action'}          | ${AppActions.SET_SPEED}    | ${'speed'}       | ${rndSpeed}\n            ${[setCounter(rndCounter)]}             | ${'sets .counter from SET_COUNTER action'}      | ${AppActions.SET_COUNTER}  | ${'counter'}     | ${rndCounter}\n        `('$testName', async ({ actions, event, stateSelector, value }) => {\n            let state: AppState = { ...defaultAppState, data: [...defaultAppState.data] };\n            actions.forEach((action: AppAction) => {\n                state = gameReducer(state, action);\n            });\n            expect(state.event).toEqual(event);\n            if (stateSelector !== null) {\n                expect(getFromState(state, stateSelector)).toEqual(getVal(actions, value));\n            }\n        });\n    });\n\n    it('inverts .visible of item(num) from INVERT action', () => {\n        const srcState = defaultAppState;\n        const id = Math.round((srcState.fieldWidth * srcState.fieldHeight - 1) * Math.random());\n        const oldVisible = srcState.data[id];\n        const inverted = getInverted(oldVisible);\n        const state2 = gameReducer(srcState, invert(id));\n        expect(state2.data[id]).toBe(inverted);\n        expect(gameReducer(state2, invert(id)).data[id]).toBe(oldVisible);\n    });\n\n    it('sets state from REPLACE_STATE action', () => {\n        const srcState = defaultAppState;\n        const newState = { ...defaultAppState, name: str(), event: AppActions.REPLACE_STATE };\n        const state2 = gameReducer(srcState, replaceState(newState));\n        expect(state2.event).toEqual(AppActions.REPLACE_STATE);\n        expect(state2).toEqual(newState);\n    });\n\n    it('returns original state from unknown action', () => {\n        const srcState = defaultAppState;\n        expect(gameReducer(srcState, { type: -1 } as unknown as AppAction)).toBe(srcState);\n    });\n\n    it('randomizes .data from FILL_PERCENT-25% action', () => {\n        const srcState = defaultAppState;\n        const expectedAliveNumber = Math.floor(srcState.fieldWidth * srcState.fieldHeight * 0.25);\n        const newState = gameReducer(srcState, fillPercent(FillPercent.P25));\n        const visibleCells = newState.data.filter((cell: CellInfo) => cell === CellInfo.alive);\n        expect(visibleCells.length).toBe(expectedAliveNumber);\n    });\n\n    it('randomizes .data from FILL_PERCENT-50% action', () => {\n        const srcState = defaultAppState;\n        const expectedAliveNumber = Math.floor(srcState.fieldWidth * srcState.fieldHeight * 0.5);\n        expect(\n            gameReducer(srcState, fillPercent(FillPercent.P50)).data.filter(\n                (cell: CellInfo) => cell === CellInfo.alive\n            ).length\n        ).toBe(expectedAliveNumber);\n    });\n\n    it('randomizes .data from FILL_PERCENT-75% action', () => {\n        const srcState = defaultAppState;\n        const expectedAliveNumber = Math.floor(srcState.fieldWidth * srcState.fieldHeight * 0.75);\n        expect(\n            gameReducer(srcState, fillPercent(FillPercent.P75)).data.filter(\n                (cell: CellInfo) => cell === CellInfo.alive\n            ).length\n        ).toBe(expectedAliveNumber);\n    });\n\n    it('randomizes .data from FILL_PERCENT-100% action', () => {\n        const srcState = defaultAppState;\n        const expectedAliveNumber = Math.floor(srcState.fieldWidth * srcState.fieldHeight * 1);\n        expect(\n            gameReducer(srcState, fillPercent(FillPercent.P100)).data.filter(\n                (cell: CellInfo) => cell === CellInfo.alive\n            ).length\n        ).toBe(expectedAliveNumber);\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/components/Cell/Cell.spec.tsx":{"tests":[{"id":"88","name":"Cell It renders <" + "article> using renderer cell with value=2","location":{"start":{"column":6,"line":15}}},{"id":"89","name":"Cell It renders <" + "article><" + "span/><" + "/article> using renderer cell with value=2","location":{"start":{"column":6,"line":31}}},{"id":"90","name":"Cell OnClick callback is called when cell is clicked","location":{"start":{"column":6,"line":48}}},{"id":"91","name":"Cell Says number of cell when clicked","location":{"start":{"column":6,"line":64}}},{"id":"92","name":"Cell renders with class \"cell\"","location":{"start":{"column":6,"line":83}}},{"id":"93","name":"Cell renders with external class \"show\" if props.alive==true","location":{"start":{"column":6,"line":100}}},{"id":"94","name":"Cell renders with inner class \"show\" if props.alive==true","location":{"start":{"column":6,"line":117}}}],"source":"import React from 'react';\nimport { mount } from 'enzyme';\nimport { Cell } from './Cell';\nimport renderer from 'react-test-renderer';\nimport { bool } from '@src/testFramework/lib/reducer';\nimport { render, screen } from '@testing-library/react';\n\ninterface RenderResult {\n    type: string;\n    children: { type: string }[];\n    props: Record<" + "string, string>;\n}\n\ndescribe('Cell', () => {\n    it('It renders <" + "article> using renderer cell with value=2', () => {\n        const snapshot = renderer\n            .create(\n                <" + "Cell\n                    num={2}\n                    onClick={() => {}}\n                    alive={bool()}\n                    isLeft={bool()}\n                    isRight={bool()}\n                    isBottom={bool()}\n                ><" + "/Cell>\n            )\n            .toJSON() as RenderResult;\n        expect(snapshot.type).toBe('article');\n    });\n\n    it('It renders <" + "article><" + "span/><" + "/article> using renderer cell with value=2', () => {\n        const snapshot = renderer\n            .create(\n                <" + "Cell\n                    num={2}\n                    onClick={() => {}}\n                    alive={bool()}\n                    isLeft={bool()}\n                    isRight={bool()}\n                    isBottom={bool()}\n                ><" + "/Cell>\n            )\n            .toJSON() as RenderResult;\n        expect(snapshot.children.length).toBe(1);\n        expect(snapshot.children[0].type).toBe('span');\n    });\n\n    it('OnClick callback is called when cell is clicked', () => {\n        const mockCallBack = jest.fn();\n        const cell = mount(\n            <" + "Cell\n                num={2}\n                onClick={mockCallBack}\n                alive={bool()}\n                isLeft={bool()}\n                isRight={bool()}\n                isBottom={bool()}\n            ><" + "/Cell>\n        );\n        cell.find('article').simulate('click');\n        expect(mockCallBack).toBeCalledTimes(1);\n    });\n\n    it('Says number of cell when clicked', () => {\n        let receivedCellNumber = 0;\n        const testCallBack = function (cellNumber: number) {\n            receivedCellNumber = cellNumber;\n        };\n        const cell = mount(\n            <" + "Cell\n                num={2}\n                onClick={testCallBack}\n                alive={bool()}\n                isLeft={bool()}\n                isRight={bool()}\n                isBottom={bool()}\n            ><" + "/Cell>\n        );\n        cell.find('article').simulate('click');\n        expect(receivedCellNumber).toEqual(2);\n    });\n\n    it('renders with class \"cell\"', () => {\n        const snapshot = renderer\n            .create(\n                <" + "Cell\n                    num={2}\n                    onClick={() => {}}\n                    alive={bool()}\n                    isLeft={bool()}\n                    isRight={bool()}\n                    isBottom={bool()}\n                ><" + "/Cell>\n            )\n            .toJSON() as RenderResult;\n\n        expect(snapshot.props.className.split(' ')).toEqual(expect.arrayContaining(['cell']));\n    });\n\n    it('renders with external class \"show\" if props.alive==true', () => {\n        const snapshot = renderer\n            .create(\n                <" + "Cell\n                    num={2}\n                    onClick={() => {}}\n                    alive={true}\n                    isLeft={bool()}\n                    isRight={bool()}\n                    isBottom={bool()}\n                ><" + "/Cell>\n            )\n            .toJSON() as RenderResult;\n\n        expect(snapshot.props.className.split(' ')).toEqual(expect.arrayContaining(['show']));\n    });\n\n    it('renders with inner class \"show\" if props.alive==true', () => {\n        render(\n            <" + "Cell\n                num={2}\n                onClick={() => {}}\n                alive={true}\n                isLeft={true}\n                isRight={bool()}\n                isBottom={bool()}\n            ><" + "/Cell>\n        );\n        expect(screen.queryByTestId('inner-cell')?.className).toBe('show');\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/store/ducks/game/game.saga.spec.ts":{"tests":[{"id":"95","name":"game.saga watchPlaySaga","location":{"start":{"column":6,"line":16}}},{"id":"96","name":"game.saga timerLoop","location":{"start":{"column":6,"line":45}}},{"id":"97","name":"game.saga sleep() sleep(1500) resolves after 1500 msec","location":{"start":{"column":10,"line":84}}},{"id":"98","name":"game.saga sleep() sleep(2000) resolves after 2000 msec","location":{"start":{"column":10,"line":84}}},{"id":"99","name":"game.saga sleep() sleep(5000) resolves after 5000 msec","location":{"start":{"column":10,"line":84}}},{"id":"100","name":"game.saga getGame(s) returns s.game","location":{"start":{"column":6,"line":100}}},{"id":"101","name":"game.saga modePlay() it returns true from mode(Mode.PLAY)","location":{"start":{"column":10,"line":107}}},{"id":"102","name":"game.saga modePlay() it returns false from mode(Mode.PAUSE)","location":{"start":{"column":10,"line":107}}},{"id":"103","name":"game.saga modePlay() it returns false from invert(1)","location":{"start":{"column":10,"line":107}}}],"source":"import { Mode, Speed, speedToDelay } from '@src/consts';\nimport { RootState } from '@src/store';\nimport {\n    AppState,\n    getGame,\n    modePlay,\n    setMode,\n    sleep,\n    timerLoopSaga,\n    watchPlaySaga,\n} from '@src/store/ducks/game';\nimport { testSaga } from 'redux-saga-test-plan';\nimport { defaultAppState, generation, invert, mode, setCounter } from './game';\n\ndescribe('game.saga', () => {\n    test('watchPlaySaga', () => {\n        const saga = testSaga(watchPlaySaga);\n        const stateMock: AppState = { ...defaultAppState, mode: Mode.PLAY };\n        const pausedStateMock: AppState = { ...defaultAppState, mode: Mode.PAUSE };\n\n        const entireFirstLoop = saga\n            .next()\n            .take(modePlay)\n            .next()\n            .put(setMode(Mode.PLAY))\n            .next()\n            .select(getGame)\n            .next(stateMock)\n            .call(timerLoopSaga); //.call(timerLoopSaga) is executed because state.mode === Mode.PLAY\n\n        const shortSecondLoop = entireFirstLoop\n            .next()\n            .take(modePlay)\n            .next()\n            .put(setMode(Mode.PLAY))\n            .next()\n            .select(getGame)\n            .next(pausedStateMock); //.call(timerLoopSaga) is skipped because state.mode !== Mode.PLAY\n\n        shortSecondLoop\n            .take(modePlay) //entered 3nd loop;\n            .finish();\n    });\n\n    test('timerLoop', () => {\n        const saga = testSaga(timerLoopSaga);\n        const stateMock: AppState = { ...defaultAppState, mode: Mode.PLAY, speed: Speed.SLOW };\n        const exitStateMock: AppState = { ...defaultAppState, mode: Mode.PAUSE, speed: Speed.SLOW };\n        const delay = speedToDelay[stateMock.speed];\n\n        const enterWhile = saga.next().select(getGame).next(stateMock);\n        const entireFirstLoop = enterWhile\n            .put(setCounter(1))\n            .next()\n            .put(generation())\n            .next()\n            .call(sleep, delay)\n            .next()\n            .select(getGame)\n            .next(stateMock);\n\n        const reenteredWhile = entireFirstLoop;\n\n        const entireSecondLoop = reenteredWhile\n            .put(setCounter(1))\n            .next()\n            .put(generation())\n            .next()\n            .call(sleep, delay)\n            .next()\n            .select(getGame)\n            .next(exitStateMock);\n\n        const exitedWhile = entireSecondLoop;\n        const timerLoopSagaIsDone = exitedWhile.isDone();\n        timerLoopSagaIsDone.finish();\n    });\n\n    describe('sleep()', () => {\n        beforeEach(() => {\n            jest.useFakeTimers();\n        });\n\n        test.each`\n            timeout\n            ${1500}\n            ${2000}\n            ${5000}\n        `('sleep($timeout) resolves after $timeout msec', ({ timeout }) => {\n            const sleepPromise = sleep(timeout);\n            jest.runOnlyPendingTimers();\n            expect(sleepPromise).resolves.toBe(undefined);\n        });\n\n        afterEach(() => {\n            jest.useRealTimers();\n        });\n    });\n\n    test('getGame(s) returns s.game', () => {\n        const gameState = { ...defaultAppState };\n        const state: RootState = { game: gameState };\n        expect(getGame(state)).toBe(gameState);\n    });\n\n    describe('modePlay()', () => {\n        test.each`\n            action              | testName              | expected\n            ${mode(Mode.PLAY)}  | ${'mode(Mode.PLAY)'}  | ${true}\n            ${mode(Mode.PAUSE)} | ${'mode(Mode.PAUSE)'} | ${false}\n            ${invert(1)}        | ${'invert(1)'}        | ${false}\n        `('it returns $expected from $testName', ({ action, expected }) => {\n            expect(modePlay(action)).toBe(expected);\n        });\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/StorageService/StorageService.saga.spec.ts":{"tests":[{"id":"104","name":"loadStateSaga dispatches REPLACE_STATE after storage.loadState returned","location":{"start":{"column":6,"line":15}}},{"id":"105","name":"loadStateSaga dispatches IO_ERROR on storageService.loadState exception","location":{"start":{"column":6,"line":26}}},{"id":"106","name":"saveStateSaga calls storageService.saveState","location":{"start":{"column":6,"line":46}}},{"id":"107","name":"saveStateSaga dispatches IO_ERROR on storageService.saveState exception","location":{"start":{"column":6,"line":52}}}],"source":"import { AppState, defaultAppState, ioError, replaceState, saveState } from '@src/store/ducks/game';\nimport { str } from '@src/testFramework/lib/reducer';\nimport { expectSaga } from 'redux-saga-test-plan';\nimport { throwError } from 'redux-saga-test-plan/providers';\nimport { call } from 'redux-saga/effects';\nimport { StorageService } from './StorageService';\nimport { getStorageService, loadStateSaga, saveStateSaga } from './StorageService.saga';\n\ndescribe('loadStateSaga', () => {\n    let mockStorageService: StorageService;\n    beforeEach(() => {\n        mockStorageService = getStorageService();\n    });\n\n    it('dispatches REPLACE_STATE after storage.loadState returned', () => {\n        const mockState = { ...defaultAppState, userName: str() };\n        return expectSaga(loadStateSaga)\n            .provide([\n                [call(getStorageService), mockStorageService],\n                [call(mockStorageService.loadState), mockState],\n            ])\n            .put(replaceState(mockState))\n            .run();\n    });\n\n    it('dispatches IO_ERROR on storageService.loadState exception', () => {\n        const error = new Error('error');\n        return expectSaga(loadStateSaga)\n            .provide([\n                [call(getStorageService), mockStorageService],\n                [call(mockStorageService.loadState), throwError(error)],\n            ])\n            .put(ioError('loadStateSaga'))\n            .run();\n    });\n});\n\ndescribe('saveStateSaga', () => {\n    let mockStorageService: StorageService;\n    let mockState: AppState;\n    beforeEach(() => {\n        mockStorageService = getStorageService();\n        mockState = { ...defaultAppState, userName: str() };\n    });\n\n    it('calls storageService.saveState', () => {\n        return expectSaga(saveStateSaga, saveState(mockState))\n            .provide([[call(getStorageService), mockStorageService]])\n            .call(mockStorageService.saveState, mockState)\n            .run();\n    });\n    it('dispatches IO_ERROR on storageService.saveState exception', () => {\n        const error = new Error('error');\n        return expectSaga(saveStateSaga, saveState(mockState))\n            .provide([\n                [call(getStorageService), mockStorageService],\n                [call(mockStorageService.saveState, mockState), throwError(error)],\n            ])\n            .put(ioError('saveStateSaga'))\n            .run();\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/StorageService/StorageService.spec.ts":{"tests":[{"id":"108","name":"MyStorage .setState(state) writes state to localStorage.state","location":{"start":{"column":6,"line":10}}},{"id":"109","name":"MyStorage .getState returns null if localStorage.state == \"\"","location":{"start":{"column":10,"line":18}}},{"id":"110","name":"MyStorage .getState returns localStorage.name if localStorage.state != \"\"","location":{"start":{"column":10,"line":23}}},{"id":"111","name":"MyStorage .getState returns null if JSON.parse(localStorage.state) throws","location":{"start":{"column":10,"line":30}}},{"id":"112","name":"MyStorage .loadState rejects if state is empty","location":{"start":{"column":10,"line":38}}},{"id":"113","name":"MyStorage .loadState resolves if state is not empty","location":{"start":{"column":10,"line":43}}},{"id":"114","name":"MyStorage .saveState resolves","location":{"start":{"column":10,"line":52}}}],"source":"import { defaultAppState } from '@src/store/ducks/game';\nimport { str } from '@src/testFramework/lib/reducer';\nimport { StorageService } from './StorageService';\n\ndescribe('MyStorage', () => {\n    beforeEach(() => {\n        localStorage.clear();\n    });\n\n    test('.setState(state) writes state to localStorage.state', () => {\n        const myStorage = StorageService.create();\n        const rndState = { ...defaultAppState, userName: str() };\n        myStorage.setState(rndState);\n        expect(JSON.parse(localStorage['state'])).toEqual(rndState);\n    });\n\n    describe('.getState', () => {\n        it('returns null if localStorage.state == \"\"', () => {\n            const myStorage = new StorageService();\n            expect(myStorage.getState()).toBe(null);\n        });\n\n        it('returns localStorage.name if localStorage.state != \"\"', () => {\n            const myStorage = new StorageService();\n            const rndState = { ...defaultAppState, userName: str() };\n            localStorage['state'] = JSON.stringify(rndState);\n            expect(myStorage.getState()).toEqual(rndState);\n        });\n\n        it('returns null if JSON.parse(localStorage.state) throws', () => {\n            const myStorage = new StorageService();\n            localStorage['state'] = 'abc';\n            expect(myStorage.getState()).toBe(null);\n        });\n    });\n\n    describe('.loadState', () => {\n        it('rejects if state is empty', () => {\n            const myStorage = new StorageService();\n            return expect(myStorage.loadState()).rejects.toBe(null);\n        });\n\n        it('resolves if state is not empty', () => {\n            const myStorage = new StorageService();\n            const rndState = { ...defaultAppState, userName: str() };\n            localStorage['state'] = JSON.stringify(rndState);\n            return expect(myStorage.loadState()).resolves.toEqual(rndState);\n        });\n    });\n\n    describe('.saveState', () => {\n        it('resolves', () => {\n            const myStorage = new StorageService();\n            const rndState = { ...defaultAppState, userName: str() };\n            return expect(myStorage.saveState(rndState)).resolves.toEqual(undefined);\n        });\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/components/GameField/GameField.spec.tsx":{"tests":[{"id":"115","name":"GameField It renders 3 cells from data:[3 items]","location":{"start":{"column":6,"line":14}}},{"id":"116","name":"GameField It calls onCellClick(<" + "cell id>) callback when a cell is clicked","location":{"start":{"column":6,"line":33}}}],"source":"import React from 'react';\nimport { GameField } from './GameField';\nimport renderer from 'react-test-renderer';\nimport { AppActions } from '@src/store/ducks/game';\nimport { mount } from 'enzyme';\nimport { CellInfo } from '@src/types';\n\ninterface RenderResult {\n    type: string;\n    children: { type: string }[];\n}\n\ndescribe('GameField', () => {\n    it('It renders 3 cells from data:[3 items]', () => {\n        const data: CellInfo[] = [CellInfo.dead, CellInfo.dead, CellInfo.dead];\n        const width = 3;\n        const snapshot = renderer\n            .create(\n                <" + "GameField\n                    data={data}\n                    onCellClick={() => {}}\n                    width={width}\n                    actionId={AppActions.INVERT}\n                ><" + "/GameField>\n            )\n            .toJSON() as RenderResult;\n        expect(snapshot.type).toBe('section');\n        expect(snapshot.children[0].type).toBe('article');\n        expect(snapshot.children[1].type).toBe('article');\n        expect(snapshot.children[2].type).toBe('article');\n    });\n\n    it('It calls onCellClick(<" + "cell id>) callback when a cell is clicked', () => {\n        const mockCallBack = jest.fn();\n        const data: CellInfo[] = [CellInfo.dead, CellInfo.dead, CellInfo.dead];\n        const lastID = data.length - 1;\n        const width = data.length;\n\n        const wrapper = mount(\n            <" + "GameField\n                data={data}\n                onCellClick={mockCallBack}\n                width={width}\n                actionId={AppActions.INVERT}\n            ><" + "/GameField>\n        );\n        wrapper.find('article').last().simulate('click');\n        expect(mockCallBack).toHaveBeenCalledTimes(1);\n        expect(mockCallBack).toHaveBeenCalledWith(lastID);\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/StorageService/StorageService.thunk.spec.ts":{"tests":[{"id":"117","name":"loadStateThunk() calls dispatch() if storage.loadState resolves","location":{"start":{"column":2,"line":5}}},{"id":"118","name":"saveStateThunk() calls storage.saveState()","location":{"start":{"column":2,"line":36}}}],"source":"import { AppState, defaultAppState } from '@src/store/ducks/game';\nimport { StorageService } from './StorageService';\nimport { loadStateThunk, saveStateThunk } from './StorageService.thunk';\n\ntest('loadStateThunk() calls dispatch() if storage.loadState resolves', (done) => {\n    const storageMock = {\n        state: defaultAppState,\n\n        setState(state: AppState) {\n            this.state = state;\n        },\n\n        getState(): AppState {\n            if (this.state) {\n                return this.state;\n            }\n            return defaultAppState;\n        },\n\n        loadState: (): Promise<" + "AppState> => {\n            return new Promise((resolve, reject) => resolve(defaultAppState));\n        },\n\n        saveState: (): Promise<" + "void> => Promise.resolve(),\n    };\n    const storage = storageMock as StorageService;\n\n    const thunkAction = loadStateThunk(storage);\n    const dispatch = jest.fn();\n    thunkAction(dispatch).then(() => {\n        expect(dispatch).toHaveBeenCalledTimes(1);\n        done();\n    });\n});\n\ntest('saveStateThunk() calls storage.saveState()', () => {\n    const storageMock = {\n        state: defaultAppState,\n\n        setState(state: AppState) {\n            this.state = state;\n        },\n\n        getState(): AppState {\n            if (this.state) {\n                return this.state;\n            }\n            return defaultAppState;\n        },\n\n        loadState: (): Promise<" + "AppState> => {\n            return new Promise((resolve, reject) => resolve(defaultAppState));\n        },\n\n        saveState: jest.fn(),\n    };\n    const storage = storageMock as StorageService;\n\n    const thunkAction = saveStateThunk(storage, defaultAppState);\n    thunkAction();\n    expect(storageMock.saveState).toHaveBeenCalledTimes(1);\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/components/LoginForm/LoginForm.spec.tsx":{"tests":[{"id":"119","name":"LoginForm calls onName() callback when submit is clicked and name is not empty","location":{"start":{"column":6,"line":8}}},{"id":"120","name":"LoginForm sends a name into props.onName() callback when submit is clicked and name is not empty","location":{"start":{"column":6,"line":19}}},{"id":"121","name":"LoginForm dos not call props.onName() callback when submit is clicked and name consists of spaces","location":{"start":{"column":6,"line":30}}}],"source":"import React from 'react';\nimport { LoginForm } from './LoginForm';\nimport { render, screen } from '@testing-library/react';\nimport userEvent from '@testing-library/user-event';\nimport { str } from '@src/testFramework/lib/reducer';\n\ndescribe('LoginForm', () => {\n    it('calls onName() callback when submit is clicked and name is not empty', () => {\n        const mockCallBack = jest.fn();\n        const rndName = str();\n        render(<" + "LoginForm onChangeName={mockCallBack} />);\n        const input = screen.getByLabelText('Enter your name:');\n        userEvent.click(input);\n        userEvent.type(input, rndName);\n        userEvent.click(screen.getByText('Start'));\n        expect(mockCallBack).toHaveBeenCalledTimes(1);\n    });\n\n    it('sends a name into props.onName() callback when submit is clicked and name is not empty', () => {\n        const mockCallBack = jest.fn( ss \"disabled\" if Boolean(props.disabled)==true', () => {\n        const snapshot = renderer\n            .create(\n                <" + "Button onClick={() => {}} disabled>\n                    aaa\n                <" + "/Button>\n            )\n            .toJSON() as RenderResult;\n\n        expect(snapshot.props.className.split(' ')).toEqual(expect.arrayContaining(['disabled']));\n    });\n\n    it('renders with class \"active\" if props.active==true', () => {\n        const snapshot = renderer\n            .create(\n                <" + "Button onClick={() => {}} active={true}>\n                    aaa\n                <" + "/Button>\n            )\n            .toJSON() as RenderResult;\n\n        expect(snapshot.props.className.split(' ')).toEqual(expect.arrayContaining(['active']));\n    });\n});\n"},"/d/Learn/ponomarenko-alex-otus/react-2021-09/game-of-life/src/components/FieldSize/FieldSize.spec.tsx":{"tests":[{"id":"125","name":"FieldSize calls setSize() callback when #btSmall is clicked","location":{"start":{"column":6,"line":8}}},{"id":"126","name":"FieldSize calls setSize() callback when #btMedium is clicked","location":{"start":{"column":6,"line":15}}},{"id":"127","name":"FieldSize calls setSize() callback when #btLarge is clicked","location":{"start":{"column":6,"line":22}}}],"source":"import React from 'react';\nimport { FieldSize } from './FieldSize';\nimport { LARGE_SIZE_CAPTION, MIDDLE_SIZE_CAPTION, Size, SMALL_SIZE_CAPTION } from '@src/consts';\nimport { render, screen } from '@testing-library/react';\nimport userEvent from '@testing-library/user-event';\n\ndescribe('FieldSize', () => {\n    it('calls setSize() callback when #btSmall is clicked', () => {\n        const mockCallBack = jest.fn();\n        render(<" + "FieldSize setSize={mockCallBack} size={Size.MIDDLE} />);\n        userEvent.click(screen.getByText(SMALL_SIZE_CAPTION));\n        expect(mockCallBack).toBeCalledTimes(1);\n    });\n\n    it('calls setSize() callback when #btMedium
